import React, { useEffect, useState } from "react";

export default function List(props) {
  let final = {};

  return (
    <div><ul>
      
    </ul>
      {props.arr.map((i) => (
        <div key={i?.id} style={{ display: "block" }}>
          <h4
            style={{ display: "inline" }}
            onClick={() => {
              final = i;
              props.details(final);
            }}
          >
            {i?.recipeName}
            <button
              style={{ marginLeft: "50px", display: "inline" }}
              onClick={() => {
                final = {};
                props.deleteObject(i?.id);
              }}
            >
              X
            </button>
            <button
              style={{ marginLeft: "50px", display: "inline" }}
              onClick={() => {
                final = {};
                props.editable(i?.id);
              }}
            >
              Edit
            </button>
          </h4>
        </div>
      ))}
    </div>
  );
}
